-- ----------------------------
-- Table structure for data_access
-- ----------------------------
DROP TABLE IF EXISTS `data_access`;
CREATE TABLE `data_access`  (
  `id` bigint(0) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `task_name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '任务名称',
  `description` varchar(300) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '描述',
  `project_id` bigint(0) NOT NULL COMMENT '项目id',
  `org_id` bigint(0) NULL DEFAULT NULL COMMENT '机构id',
  `source_type` int(0) NOT NULL DEFAULT 1 COMMENT '1-指定表 2-自定义SQL',
  `source_database_id` bigint(0) NOT NULL COMMENT '源端数据库id',
  `target_database_id` bigint(0) NULL DEFAULT NULL COMMENT '目的端数据库id（同步方式为1有此值）',
  `access_mode` int(0) NOT NULL COMMENT '接入方式 1-接入ods 2-自定义接入',
  `task_type` int(0) NOT NULL COMMENT '任务类型 1-实时同步 2-一次性全量同步 3-一次性全量周期性增量',
  `cron` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT 'cron表达式（秒 分 时 日 月 星期 年，例如 0 0 3 * * ? 表示每天凌晨三点执行）',
  `status` int(0) NOT NULL DEFAULT 0 COMMENT '发布状态 0-未发布 1-已发布',
  `run_status` int(0) NOT NULL DEFAULT 1 COMMENT '最新状态 1-等待中 2-运行中 3-正常结束 4-异常结束',
  `data_access_json` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '数据接入基础配置json',
  `start_time` datetime(0) NULL DEFAULT NULL COMMENT '最近开始时间',
  `end_time` datetime(0) NULL DEFAULT NULL COMMENT '最近结束时间',
  `release_time` datetime(0) NULL DEFAULT NULL COMMENT '发布时间',
  `note` varchar(300) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '备注',
  `release_user_id` bigint(0) NULL DEFAULT NULL COMMENT '发布人id',
  `next_run_time` datetime(0) NULL DEFAULT NULL COMMENT '下次执行时间',
  `version` int(0) NULL DEFAULT NULL COMMENT '版本号',
  `deleted` tinyint(0) NULL DEFAULT NULL COMMENT '删除标识  0：正常   1：已删除',
  `creator` bigint(0) NULL DEFAULT NULL COMMENT '创建者',
  `create_time` datetime(0) NULL DEFAULT NULL COMMENT '创建时间',
  `updater` bigint(0) NULL DEFAULT NULL COMMENT '更新者',
  `update_time` datetime(0) NULL DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 120019 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '数据集成-数据接入' ROW_FORMAT = DYNAMIC;

